import React from "react";
import { signOut } from "firebase/auth";
import { auth } from "./Firebase";
import Signup from "./page/Signup";
import Login from "./page/Login";
import Navbar from "./page/Navbar";
import Services from "./page/Services";

import { useNavigate } from "react-router-dom";

const Home = ({ user }) => {
  const navigate = useNavigate();

  const handleLogout = () => {
    signOut(auth)
      .then(() => {
        // Sign-out successful.
        navigate("/");
        console.log("Signed out successfully");
      })
      .catch((error) => {
        // An error happened.
        console.error("Error signing out:", error);
      });
  };

  return (

      <nav className="home">
             <section>
          <Routes>
            <Route path="/" element={<Home user={user} />} />
            <Route path="/signup" element={<Signup />} />
            <Route path="/login" element={<Login />} />
            <Route path="/services" element={<Services />} />
          </Routes>
        </section>
        <h1 className="mision">Tu tranquilidad es nuestra misi√≥n</h1>
        <h1 className="vision">Tu confianza nos impulsa. Brindamos soluciones de ciberseguridad de clase mundial para que puedas enfocarte en hacer crecer tu negocio sin temor a interrupciones.</h1>
        <button className="buttonn" onClick={handleLogout}>Analisis Gratuito</button>
        <div>
          {user ? (
            <button onClick={handleLogout}>Logout</button>
          ) : (
            <p></p>
          )}
        </div>
      </nav>
  );
};

export default Home;
